import React from 'react';
import imgNFT from './img/image-equilibrium.jpg'

class CardImg extends React.Component {
    render() {
        return (
            <div className="container ">

            <img src={imgNFT} alt="" className="card-img-top p-3" />
            <div id="imgHover" className="">

            </div>
            </div>

            
        )
    }
}

export default CardImg;
